import React, { useState, useEffect, useRef } from "react";

import Board from './Board';
import RightSide from "./RightSide";
import LeftSide from "./LeftSide";

import '../styles/home.css';

export default function Home() {

    const [buttonsTarget, setButtonsTarget] = useState(null);

    const returnButtonsClick = (e) => {
        console.log('ok', e.target);
        setButtonsTarget(e.target);
    };
    
    return (
        <div className="game">
            <LeftSide />
            <Board color={1} prevButtons={buttonsTarget}/>
            <RightSide clickButton={returnButtonsClick}/>
        </div>
    );
};
